                newRectListNode->next = *pCur;

                *pCur = newRectListNode;
                pCur = &(newRectListNode->next);

                v2.lry = v1.lry;
            }

            if (v2.ulx < v1.ulx) {
                RectPtr newRectListNode = rect_malloc();
                if (newRectListNode == NULL) {
                    return;
                }

                rectCopy(&(newRectListNode->rect), &v2);
                newRectListNode->rect.lrx = v1.ulx - 1;
                newRectListNode->next = *pCur;

                *pCur = newRectListNode;
                pCur = &(newRectListNode->next);
            }

            if (v2.lrx > v1.lrx) {
                RectPtr newRectListNode = rect_malloc();
                if (newRectListNode == NULL) {
